Let's implement Parser for the Character struct. We will be guided by the outline above impl<'a> Parser<'a, char> for Character { fn parse(&self, input: &'a str) -> Result<(char, &'a str), ParseError> { if input.starts_with(self.character_to_match) { Ok((self.character_to_match, &input[1..])) } else { Err(ParseError::ExpectingCharacter(self.character_to_match)) } }
} The first two lines are the signature needed to adhere to the traits contract. Next we check if the input starts with the character to match. If it does, we return a succesful parse with the matched character and the remaining input. Otherwise we announce an error, which we also need to add to our ParseError enum. #[derive(Debug, PartialEq)]
pub enum ParseError { GenericError, ExpectingCharacter(char),
}

