By now the strategy to creating a parser is not new. Now we have to think about what we need to represent this parser. We need some sort of lower bound, an upper bound and a parser that we want to parse between the lower and upper bound times. The lower bound can be just a number. Because you can not parse less than zero times, negative numbers are not necessary. The type for the lower bound can be any unsigned number. We will settle for u8. The upper bound is a little trickier. There is no natural limit, we could be interested in all characters that match a certain parser. To accomadate this we are going to introduce a custom enum Limit. pub enum Limit { At(u8), Infinity,
} This way we can specify either an unlimited bound, or a bound at a specific value. Because we likely will want to check if the upper bound is reached, we introduce a method that allows use to check that. impl Limit { pub fn is_bigger_then(&self, n: u8) -> bool { match self { Limit::At(threshold) => threshold > &n, Limit::Infinity => true, } }
} That are almost all the considerations for the Between struct we need. Let's see if you can come up with an implementation. Do note that you probably need to think about PhantomData at some point.
